import weaviate

client = weaviate.Client("http://localhost:8080")

# QUERY EXAMPLE ONE 

query_one = """
{
  Get {
    Products (
      where: {
        operator: IsNull, path: "price", valueBoolean: true}
    ) {
      price
      short_description
      title
    }
  }
}
"""

result = client.query.raw(query_one)
print(result)

# QUERY EXAMPLE TWO

query_two = """
{
  Get {
    Products (
      nearText: {
        concepts: "network cable"
      }) {
      short_description
      title
      _additional {
        certainty
      }
    }
  }
}
"""

result = client.query.raw(query_two)
print(result)

# QUERY EXAMPLE THREE

query_three = """
{
  Get {
    Products(
      hybrid: {query: "laptop", alpha: 0.75},
      where: {
      operator: And,
      operands: [{
          path: "price",
          operator: GreaterThan,
          valueNumber: 100
        }, {
          path: "price",
          operator: LessThan,
          valueNumber: 2000
        }]
      }) {
		price
        title
        short_description
    }
  }
}
"""

result = client.query.raw(query_three)
print(result)

# QUERY EXAMPLE FOUR

query_four = """
{
  Get {
    Products(
      bm25: 
        {query: "hp laptop", properties: ["title^2", "short_description"]}
    ){
        price
        title
        short_description
        _additional {
            score
      }
    }
  }
}
"""

result = client.query.raw(query_four)
print(result)

# QUERY EXAMPLE FIVE - WITH IMAGES
# For images queries
# GraphQL doesn't support png->base64 encoding, so please use a base64 encoded image in your query

query_five = """
{
  Get {
    Products(nearImage: {
      image: ""
    }) {
      title,
      name,
      price,
      short_description
    }
  }
}
"""

# QUERY EXAMPLE SIX
# Hybrid example with text and price filter
query_six = """
{
  Get {
    Products(
      hybrid: {query: "notebook", alpha: 0.75},
      where: {
      operator: And,
      operands: [
        {
          path: "supplier",
          operator: Equal,
          valueText: "HP"
        },
        {
          path: "price",
          operator: GreaterThan,
          valueNumber: 100
        }, 
        {
          path: "price",
          operator: LessThan,
          valueNumber: 2000
        }
      ]
      }) 
    {
	price
    title
    short_description
    }
  }
} """
